import React, { useState } from 'react';
import { Text, View, StyleSheet,
         Button, ImageBackground} from 'react-native';

const Login = props => {
  return (
    <ImageBackground source={require('../img/MainBackground.jpg')}
                       style={styles.background}>
        <Text style={styles.title}>
          Sign In
        </Text>
        <View style={styles.buttonHandler}>
          <Button title="Sign In" />
        </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
    alignItems: 'center',
    justifyContent:'center'
  },
  buttonHandler: {
    flexDirection: 'row',
    width: '80%',
    justifyContent: 'center',
    alignItems: 'center',
    position: 'absolute',
    bottom: 10,
    padding: 50
  },
  title: {
    justifyContent: 'center',
    alignItems: 'center',
    fontFamily: 'LeagueSpartan-Bold.otf',
    fontSize: 64,
    fontWeight: 'bold',
    color: 'white'
  }
});

export default Login;
